css:
atom-text-editor::shadow .atom-jshint-error {
  color: #ff0000;
}
.atom-jshint-pane {
  font-size: 11px;
  line-height: 22px;
  color: #00cc00;
  font-weight: normal;
  background-color: #000000;
  overflow: auto;
  max-height: 80px;
  border-top: 1px solid #0a2814;
  padding: 0 12.5px;
  cursor: pointer;
}
.atom-jshint-pane span:hover {
  text-decoration: underline;
}
